import React from "react";
import { useState } from "react";

function DataLoad() {
  const key = "5894ecf675f64f28cd358b417ed6ad1b";
  axios
    .get(
      "http://www.career.go.kr/inspct/openapi/test/questions?apikey=" +
        key +
        "%7B%7D&q=6%27",
      {
        params: {
          ID: 12345,
        },
      }
    )
    .then(function (response) {
      console.log(response);
    });
}
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>직업 가치관 검사</p>
      </header>
      <label>
        {" "}
        이름:
        <input type="text" name="name" />
      </label>
      <br />
      <label>
        <input
          type="radio"
          name="radioGroup"
          value="react"
          // checked={this.state.radioGroup["react"]}
          // onChange={this.handleRadio}
        />
        여자
      </label>
      <br />
      <label>
        <input
          type="radio"
          name="radioGroup"
          value="polymer"
          // checked={this.state.radioGroup["polymer"]}
          // onChange={this.handleRadio}
        />
        남자
      </label>
      <br />
      <button onclick="activateLasers()">검사시작</button>
    </div>
  );
}

export default App;
